Since the document you provided is an image and does not entirely follow the format of an Executive Document Summary form with checkboxes, I'll interpret the visible elements and provide a detailed description of the text in the image in JSON format. Note that I’ll include information verbatim from the image, organized as if it were structured data:

```json
{
  "document": {
    "title": "MEMORANDUM OF UNDERSTANDING",
    "contract_number": "000000000000000000000000045516",
    "parties_involved": [
      {
        "name": "Indiana Department of Natural Resources",
        "abbreviation": "IDNR"
      },
      {
        "name": "Indiana Department of Environmental Management",
        "abbreviation": "IDEM"
      }
    ],
    "objective": "Documenting the use of IDEM’s Geoprobe® direct push drilling device to identify subsurface suitability for potential project development.",
    "details": [
      "This will be a cooperative effort between IDEM and IDNR for use of IDEM’s Geoprobe® for characterization of subsurface site investigations and materials for construction of manmade containment structures for Indiana Lakes under IDNR’s control. In return, IDNR will provide reimbursement of time and expenses incurred by IDEM.",
      "Whereas, IDEM owns the Geoprobe® needed to identify subsurface suitability for natural lake containment structures.",
      "Whereas, IDNR has need for the Geoprobe® to conduct subsurface stabilization research.",
      "Whereas, IDEM and IDNR have worked jointly to arrive at a mutually agreeable resolution to facilitate the use of IDEM’s Geoprobe® and believe it is in the best interests of the both parties to memorialize and continue such cooperation and coordination;"
    ],
    "agreement": {
      "terms_and_conditions": [
        "IDEM shall provide for IDNR upon a mutually agreed date for services, a Geoprobe®, a driller, and a driller’s assistant to carry out the needs of IDNR for determining suitability of subsurface materials for lake control structures.",
        "IDEM shall have the final decision on scheduling of drilling dates to assist IDNR, based on other scheduling of the Geoprobe or Operator.",
        "IDEM may provide informal and technical assistance, through its Office of Land Quality, if IDEM determines it is necessary.",
        "All decisions on all drilling activities will be at the final discretion of the driller who has the right to deny boring at any location deemed unsafe or impractical.",
        "IDEM shall provide maintenance and repair of the Geoprobe®.",
        "For sites requiring subsurface material identification, IDNR shall reimbursement IDEM with wages at a rate of $518.32 per 7.5 hour day per IDEM employee. When a full day of work is not warranted, IDNR shall reimbursement IDEM for wages at the rate of $69.11 per hour per IDEM employee. When hours over a typical day are warranted, IDNR shall reimbursement IDEM for wages at the rate of $69.11 per hour per IDEM employee, not to exceed 40 hours in a work week. Lodging, mileage, and per diem will be reimbursed at the current state government rate. IDNR shall reimbursement IDEM for materials at the rate of $22.65 per hole drilled. Approximately 50 holes to pull for samples. Not to exceed $15,000.00."
      ]
    }
  }
}
```

